import React from 'react';
import './App.css';

function App() {

  state={
    word:"",
  }

  onWordChange = (e) =>{
    this.setState({
      ...this.state,
      word:e.target.value
    })
  }

  return (
    <div >
     <label htmlFor="word-search">Word</label>
     <input type="text" value={this.props.word} name="word" id="word-search" onChange={this.onWordChange}/>
    </div>
  );
}

export default App;
